import React, { Component } from "react";
import "./App.css";

import background from './images/beach.JPG'
function App() {
  return (
    <div style={{ backgroundImage: `url(${background})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    width: '100%',
    height: '900px',}} >
      test
    </div>
  );
}

export default App;
